import { useEffect,useState } from "react";

function Example(){

    let [data , setdata] = useState([])

    useEffect(()=>{
        fetch("https://gorest.co.in/public/v2/users").then((res)=>res.json()).then((user)=>{
            setdata(user)
        })
    },[])

    return(
        <>
            <h1>Hello</h1>
            {
            data.filter((e) => e.status === "inactive" && e.gender === "female").map((e)=>{
                return(
                    <>  <p>{e.name}</p>
                    </>

                )
            })
            }
        </>
    )

}

export default Example
